import React from 'react';
//import logo from '../../img/logo-187x66.png';
import classes from './Home.module.css'
import BlockHead from "../BlockHead/BlockHead";
import BannerHead from '../../img/banner_img.png'

let head =[
    {
        text:"we conceptualize design and develop apps  that people love",
        img: BannerHead
    }
] ;


const  Home = () =>{
    return (
        <div className={classes.block}>
            <BlockHead  text={head[0].text} img={head[0].img}/>

        </div>
    );
};


export default Home;
